function getFinances(e){e.dashboard.filter(e=>"finances"==e.type).map(e=>[income,expense]=e.data);let n=income.income,t=expense.expense;var o=document.getElementById("incomeTotal"),s=document.getElementById("expenseTotal");let r=0,c=0;for(i=0;i<n.length;i++)r=n[i].income_price+r;for(i=0;i<t.length;i++)c=t[i].income_price=c;o.innerText="$"+r,s.innerText="$"+c,console.log(t)}fetch("https://my-json-server.typicode.com/bytebeardigital/vanilla-js/db").then(function(e){return e.json()}).then(function(e){getFinances(e)}).catch(function(e){console.log(e)});class Person{constructor(e,n,t){this.fname=e,this.lname=n,this.profession=t}get fullname(){return this.fname+"-"+this.lname}get position(){return"Position: "+this.profession}}const person=new Person("Bryanna","Gardner","Front-End Developer");document.getElementById("name").innerHTML=person.fname+" "+person.lname,document.getElementById("position").innerHTML=person.position;